import React, {useState} from "react";
import Modal from 'react-modal'
export default function Header() {
  const [modalIsOpen, setModalIsOpen] = useState(true)
  return (
    <header>
      <div className='header-inner'>
        <a className='logo'>Ian M.</a>
        <nav>
          <ul>
            <li>
              <a href='/'>about</a>
            </li>
            <li>
              <a href='/about'>Work</a>
            </li>
            {/* <li className='btn'>
              <a href='/'>Contact</a>
            </li> */}
          </ul>
        </nav>
      </div>
    </header>
  );
}
